INSERT INTO `comics` VALUES (52,'ワンパンマン','http://www.tonarinoyj.jp/manga/onepanman/','時代が求めたニューヒーロー『一撃男』と言えば?!?\r\n『WEB界のカリスマ』と『最強ジャンプ遺伝子』の超強力タッグが描き出す！ 平熱系最強ヒーロー“サイタマ”の日常ノックアウトコミック!!\r\n\r\nニコニコ静画「ワンパンマン静止画MADコンテスト」グランプリ受賞作決定！\r\n詳細はこちらから！\r\n','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/onepunchman-tn-thumb-180xauto-239.jpg'),(53,'剣光妃-日ノ国大帝國軍くれない一騎当千隊-','http://www.tonarinoyj.jp/manga/kenkouki/','時は明大正(めいたいせい)時代――。\r\n日ノ国大帝國は敵国・アトラバルとの熾烈な抗争を繰り広げていた。父を軍人に持つ主人公・秋山まいかは、失踪した父の行方を追うために、田舎を飛び出し“一騎当千隊”が寄港している順洋港へ。父を知る一騎当千隊隊長“無敗の白狼”の背を追い、女ながらに“一騎当千隊”へ志願することを決意するが…!?\r\n\r\n週刊ヤングジャンプ誌上で大反響を巻き起こした“空想大正浪漫連載”、\r\n大幅な加筆＆修正を経て、ついにコミックス①巻が11/19（水）発売!!\r\n\r\nとなりのヤングジャンプに移籍連載につき、\r\n「修正リマスター版」を期間限定で特別公開!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/kenkouki-tn-thumb-180xauto-219.jpg'),(54,'文句の付けようがないラブコメ','http://www.tonarinoyj.jp/manga/lovecome/','“千年を生きる神”神鳴沢セカイは、銀髪赤眼の美少女。世間知らずで尊大で、見た目は幼いのに酒と葉巻をたしなみ、一日中お屋敷で本を読んで過ごしている。\r\n　彼女の”生贄”として捧げられた高校生・桐島ユウキ。『生贄になる代わりに何でも言うことを聞いてやろう』と言われた彼はこう願い出た――「神鳴沢セカイさん。俺と結婚してください」。\r\n　そして始まるふたりの生活だが――穏やかで他愛のない日々は、やがて世界が抱える恐るべき秘密によって狂い始めていく。\r\n　どこまでも純粋な二人の愛の喜劇《ラブコメディ》。決して果てることのない物語がここに始まる！\r\n　ライトノベル『文句の付けようがないラブコメ』の超速コミカライズ開幕！！\r\n\r\n\r\n      ','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/monk_tn-thumb-180xauto-213.jpg'),(55,'憂鬱くんとサキュバスさん','http://www.tonarinoyj.jp/manga/yuutukun/','人の精を吸い、糧とする恐ろしい悪魔「サキュバス」。\r\n彼女がターゲットに定めた青年は日々の過酷な労働に心身を消耗し性欲すらも失うほどの憂鬱な状態。だが、このサキュバス、幸か不幸か非常に前向きであった。\r\n青年を癒し、再び性欲を取り戻させるため、強引に居候生活を開始してしまう！','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/09/thamu-thumb-180xauto-409.jpg'),(56,'明日はともだちじゃない','http://www.tonarinoyj.jp/manga/asutomo/','心揺れる思春期。何気ない一言や思わず口にしてしまった本音。\r\n瞬時に、微妙に、それでいて取り返しがつかぬほど、変わってしまう、男の子と女の子の関係性。\r\n「恋が始まる、30秒の瞬間」を切り取った、ピュアオムニバスストーリー。','http://www.tonarinoyj.jp/manga/assets/assets_c/2016/05/asutomo-thumb-180xauto-551.png'),(57,'秋田妹！えびなちゃん','http://www.tonarinoyj.jp/manga/ebinachan/','ニコニコ静画で実施した、\r\n「干物妹！うまるちゃん」キャラ人気投票で、\r\n圧倒的1位を獲得した大人気・海老名菜々ちゃんが\r\n主人公のスピンオフ新連載がスタート!!\r\n\r\n本編では、うまる達と八王子の荒矢田高校で過ごす、海老名ちゃん。\r\n高校入学をきっかけに東京にやってくる前、\r\n秋田で暮らしていた日々も描かれる!?\r\n\r\n方言あり、グルメあり、恋愛要素までありの\r\n海老名ちゃんスピンオフ!!\r\n\r\n海老名“菜々”にちなんで、\r\n毎月“7日”の月イチ更新で新連載スタート!!\r\n\r\n『干物妹！うまるちゃん』アニメ公式 商品情報はこちらから','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/12/ebina_thumb-thumb-180xauto-467.jpg'),(58,'息子がかわいくて仕方がない魔族の母親','http://www.tonarinoyj.jp/manga/mazoku/','絶滅寸前の魔族に生まれた一人の少女。\r\n時が経ち、大人になり、そして母親になった。\r\n翼を折り、爪を隠し、全ての愛は息子のために。','http://www.tonarinoyj.jp/manga/assets/assets_c/2016/05/mazoku_tn-thumb-180xauto-559.jpg'),(59,'今日のテラフォーマーズはお休みです。','http://www.tonarinoyj.jp/manga/terraformars/','','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/kyounoterafo-tn-thumb-180xauto-224.jpg'),(60,'オークが女騎士を育成してみた','http://www.tonarinoyj.jp/manga/orc/','「くっ！殺せ！」オークに囚われてしまった誇り高き女騎士。\r\n辱めを選ぶより死を…のはずだったが、そのあまりに不摂生な肉体に\r\n呆れたオークはそのぐうたらな性根と身体を叩き直すことを決意。\r\n運動不足な現代人に贈る、新感覚ダイエットファンタジー！','http://www.tonarinoyj.jp/manga/assets/assets_c/2016/06/icon-thumb-180xauto-570.png'),(61,'パンティトラップ','http://www.tonarinoyj.jp/manga/panty/','女の子のパンティが好きすぎるあまり、パンティを履くようになってしまった\r\nヤンキー男子・高山。ある日、その秘密が同じ高校の優等生・飯島にバレて\r\nしまったから、さあ大変！\r\n秘密を握られた高山は、何故かことあるごとに飯島に呼び出され、下着姿を\r\n撮影されることに。\r\n住む世界が違うはずの二人の距離は、パンティをきっかけに急接近していく!?\r\n\r\n★第9話（最終話）の公開は7月12日（火）23:59までとさせていただきます。何卒よろしくお願いいたします。 ','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/10/panty-thumb-thumb-180xauto-437.jpg'),(62,'社畜と幽霊','http://www.tonarinoyj.jp/manga/shatiku/','激務と残業に追われて磨耗する社畜・背山さん。\r\n孤独に残業する彼の元に、かまってほしい幽霊が現れて…！？','http://www.tonarinoyj.jp/manga/assets/assets_c/2016/05/thm_shatiku-thumb-180xauto-549.jpg'),(63,'ツインドルの箱庭','http://www.tonarinoyj.jp/manga/twindle/','双子の魔法使いのジルとジゼル。\r\n弟のジルは将来を期待されるぬいぐるみ職人だが、\r\n姉のジゼルはドジで不人気な看護師。\r\n「同じ杖を持ってるはずなのに、どうして…。」\r\n\r\nジゼルが一人静かに悩んでいる時、事件は起きた――。\r\n\r\n新鋭イラストレーター、稚野まちこがフルカラーで贈る、\r\n花と魔法の極上ファンタジー開幕！','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/10/twindle_sum-thumb-180xauto-434.jpg'),(64,'しゃべっても猫','http://www.tonarinoyj.jp/manga/shabettemoneko/','','http://www.tonarinoyj.jp/manga/assets/assets_c/2016/04/thmb-thumb-180xauto-528.jpg'),(65,'ひゃくにちかん!!','http://www.tonarinoyj.jp/manga/100days/','低体温男子、ミーツ…？？\r\nお互いの両親が海外勤務につき、\r\n一緒に住むことになった秀人（しゅうと）とちほ。\r\n慣れない共同生活、得体の知れない女の子。\r\n問題は山積み！　でも３か月間のがまん…!?','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/10/100days-thumbnail-thumb-180xauto-430.png'),(66,'灼熱の卓球娘','http://www.tonarinoyj.jp/manga/shakunetu/','王者が陥落し、波乱の時代を迎えた中学女子卓球界。雀が原中学にやってきた転校生・旋風こよりが、新たな風を巻き起こす…!?','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/05/tm_syakunetu-thumb-180xauto-344.jpg'),(67,'ウイナーズサークルへようこそ','http://www.tonarinoyj.jp/manga/winnerscircle/','三流大学に通う冴えない大学生・山川七雄の前に現れたのは、怪しげな占い師。お宝があると予言された場所に足を運ぶとそこは…競馬場！？当たり外れ、笑い泣く。人生の勝ち組を夢見る「ウイナーズサークル」の面々が織り成す、青春ドラマが今走り出す――！！\r\n\r\n「ジャンプ改」で大反響を生んだ甲斐谷忍の大人気競馬コミック!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/winners-tn-thumb-180xauto-210.jpg'),(68,'竜と勇者と配達人','http://www.tonarinoyj.jp/manga/haitatsunin/','拝啓 市民の皆様。\r\nわたくし皇帝都市アイダツィヒの駅逓局(えきていきょく)に勤めております、\r\nハーフエルフの吉田と申します。\r\n御用とあらば天空の城から大地の大穴まで、\r\n書簡を携えて馳せ参じるのがわたくしのお仕事です──。\r\n\r\n無類の中世愛好家である新鋭が描く、\r\nファンタジー世界を斜めから穿つ極上のエンタテインメント!\r\n各話の結びには「中世欧州こじつけコラム」付き。','http://www.tonarinoyj.jp/manga/assets/assets_c/2016/02/th_d_h_p-thumb-180xauto-502.jpg'),(69,'きみ×××ることなかれ','http://www.tonarinoyj.jp/manga/kiminakare/','アイドルグループ“warp”のメンバー・隼人と芸人・のぶ子は、同じ高校の芸能科に通うクラスメイト。\r\n幼い頃からテレビに出ていたのぶ子に憧れてアイドルになった隼人。その気持ちはいつしか恋心に…！\r\nいっぽう、恋愛に免疫がないのぶ子は、隼人からの初めての告白に戸惑い、「友達」でいようとするのですが!?\r\n\r\nアイドルとお笑い芸人――普通の高校生とはちょっと違う世界に生きているけれど、恋に悩む気持ちは普通の高校生と同じこと。\r\n青春真っただ中を走る二人の、恋の行方は！？\r\n\r\n恋愛マンガの旗手・御徒町鳩が描く、胸キュンが止まらない新作ラブコメディ！','http://www.tonarinoyj.jp/manga/assets/assets_c/2016/03/kiminakare_tn-thumb-180xauto-522.jpg'),(70,'ライフル・イズ・ビューティフル','http://www.tonarinoyj.jp/manga/rifle/','私たち、撃ちます――。\r\n運動神経がいらない？ 東京五輪も目指せる？ \r\nそんなライフル射撃の世界をそこはかとなく描く、サルミアッキ先生の描く千鳥高校射撃部４コマ。','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/08/samune-thumb-180xauto-392.jpg'),(71,'週刊ヤングジャンプ＆ミラクルジャンプ連載作品試し読み','http://www.tonarinoyj.jp/manga/yj_mj/','','http://www.tonarinoyj.jp/manga/assets/assets_c/2016/06/g-rethumb-thumb-180xauto-578.png'),(72,'悟りパパ','http://www.tonarinoyj.jp/manga/satori/','脱サラして「悟り」を開いたパパ。\r\n仏の教えを説きながら主夫業に勤しむパパのことを\r\n（ちょっと変だなと思いつつ）慕う小学生の息子、梵くん。\r\nそして、二人を（ほどよく）見守る会社勤めのママ。\r\n\r\nこの物語はそんな一家を描いた珍妙なフィクションです。','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/10/SATORIPAPA_tm-thumb-180xauto-447.jpg'),(73,'しんそつ七不思議','http://www.tonarinoyj.jp/manga/shinsotsu/','地方の中小企業「食品容器の遠州」が採用した新卒は３人！クールだけど脱力系、マイペースだけどハイテンションな、社会人たちが織り成す、ビジネスマン必見のお仕事４コマ！！','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/05/tm_shinsotsu-thumb-180xauto-362.jpg'),(74,'週刊ヤングジャンプ月例新人マンガ賞 シンマン賞 受賞作品','http://www.tonarinoyj.jp/manga/shinman/','','http://www.tonarinoyj.jp/manga/shinman/images/thumb.png'),(75,'黒','http://www.tonarinoyj.jp/manga/kuro/','アオハルオンラインに掲載された話題作が一挙再掲載＆移籍新連載！ 真っ黒な猫『クロ』と少女『ココ』。大きなお屋敷にふたりだけで暮らす毎日は、可愛くて楽しくて、どこか不気味でーー!? 紙袋にはまったり、スズメにじゃれたり、元気でやんちゃなクロと、そんなクロが大好きなココ。ふたりはいつも仲良しだけど、ココが気づかない、クロの一面がありーー？ 謎が謎呼ぶ、フルカラーコミック！','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/kuro-tn-thumb-180xauto-227.jpg'),(76,'魔界のオッサン','http://www.tonarinoyj.jp/manga/makai/','ＷＥＢコミック界のカリスマによる勤労感謝バーリ・トゥードなＧＡＧコミック!!\r\n','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/osan-tn-thumb-180xauto-238.jpg'),(77,'僕と宇宙人','http://www.tonarinoyj.jp/manga/bokuchu/','中学3年生「山本 学」のクラスにやってきた「そら るり」はパロピル星の宇宙人!?\r\nそんなるりに学が適当に発した言葉は偶然にもパロピル語の愛の告白だった!!??\r\nこうして奇想天外な僕たちの学園生活がスタートする!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/08/%E3%81%A8%E3%81%AA%E3%82%B8%E3%83%A3%E3%83%B3%E3%80%8C%E5%83%95%E3%81%A8%E5%AE%87%E5%AE%99%E4%BA%BA%E3%80%8D%E3%82%B5%E3%83%A0%E3%83%8D%E3%82%A4%E3%83%AB%E6%96%B0-thumb-180xauto-400.png'),(78,'シンマンGP2016','http://www.tonarinoyj.jp/manga/shinman_gp/','','http://www.tonarinoyj.jp/manga/assets/assets_c/2016/03/thumb-thumb-180xauto-518.png'),(79,'続・おかいこぐるみ！','http://www.tonarinoyj.jp/manga/kaiko/','あるところに、１人のあみぐるみが趣味な青年と、\r\nお気楽ごくらくなお喋り蚕がおったそうな……。\r\n１人と２匹は、毎日つつがなく暮らしていたが、\r\nそこへ突然の訪問者が現れて――!?\r\n\r\n前シリーズ「蚕三文記/続・蚕三文記」も\r\nページ下部で公開中です♪\r\n\r\n☆ヒメちゃん、アトちゃんとの出会いや\r\n読んでためになる蚕の豆知識など\r\n必見の内容が盛りだくさん☆','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/09/okaiko_sum-thumb-180xauto-404.jpg'),(80,'KILLER☆KILLER GIRLS！','http://www.tonarinoyj.jp/manga/killerkiller_girls/','スケイプ・ゴトウは、ジャパニーズMANGA、特に日常系漫画が大好きな普通の女の子。ただし彼女は死刑囚！ 刑務所という非日常で、日常系漫画のような「ゆるふわかわいい」生活を送ろうとするスケイプですが…？ 一癖ある囚人たちと繰り広げる日常系志向コミック！','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/killerkiller_tn-thumb-180xauto-217.jpg'),(81,'黒鉄の太陽　外伝','http://www.tonarinoyj.jp/manga/kurogane/','“太陽”を巡り、深淵なる地底世界で勃発した文明闘争スペクタクル\r\n『黒鉄の太陽』が遂に待望の二か月連続コミックス発売!!\r\n\r\nそれを記念し、地底世界を色濃く生き抜いた“あのキャラクター達”それぞれの\r\n物語をオムニバス形式で綴るセルフスピンオフ連載がここに開幕!!\r\n\r\n原作を知っている人も、まだ知らない人も「黒鉄ワールド」を２倍楽しめる\r\nもう1つの地底世界フロンティアファンタジー!!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/11/kurogane_thamb-thumb-180xauto-460.jpg'),(82,'ほおじょく','http://www.tonarinoyj.jp/manga/ojo/','となジャン公式Twitterにて平日毎日更新中！\r\nほっぺた陵辱４コマ界の1番人気!!(たぶん)『ほおじょく』をまとめて公開中!!\r\n小さな体に王者の風格『おじょうさん』。おじょうさんのほっぺを狙う謎の美女『おねえさん』。\r\n頬と指先の攻防戦!!最後に勝つのはどっちだ!?','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/08/hojoku-tn-thumb-180xauto-401.jpg'),(83,'有害都市','http://www.tonarinoyj.jp/manga/yugaitoshi/','2019年、東京の街ではオリンピックを目前に控え、“浄化作戦”と称した異常な排斥運動が行われ、猥褻なもの、いかがわしいものを排除するべきだという風潮に傾き始めていた。\r\nそんな状況下で、人の屍肉を食べたいという抗し難い欲求にかられる“食屍病”の蔓延を描く作品を発表する一人の漫画家がいた。“表現の自由”を巡る業界震撼の衝撃作!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/yugaitoshi_tn-thumb-180xauto-215.jpg'),(84,'ヴァン・ヘルシング Darkness Blood','http://www.tonarinoyj.jp/manga/van_helsing/','伝説のヴァンパイアハンター、ヴァン・ヘルシング。\r\n人々の願望が生み出した空想上の人物ともいわれる謎の男が、\r\n無垢なる少女の叫びに応え、今、現れる!!\r\n無敵にして不死なるヴァンパイアに対し、\r\n粘っこくも騒々しい、あの手この手で戦いを挑む!!\r\n美麗な絵柄と残念なバトルのギャップの笑いに\r\nあなたは耐えられるか!?','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/van_tn-thumb-180xauto-248.jpg'),(85,'深海ランデブー','http://www.tonarinoyj.jp/manga/shinkai/','「深い海の底で、僕らは出会ったんだ」\r\n深海、未だ多くの謎に包まれた闇の世界から、\r\n一匹のダイオウグソクムシを連れだしてきた主人公・二見。\r\n\r\n期待の新星・ぶきやまが、奇特な異種間交流を描いた衝撃作！\r\n可愛いときどきダークな新感覚ファンタジーを体験せよ!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/shinkai_sum-thumb-180xauto-314.jpg'),(86,'アゼット','http://www.tonarinoyj.jp/manga/azet/','独特の個性を持ち生まれてくる種“ユニィ”。\r\n彼らが集まる学校で教壇に立つゾディは、ちょっぴり人付き合いが苦手。\r\n\r\nしかし自分と正反対な存在・アゼットとの出会いが、\r\n彼の心に少しずつ変化をもたらしていく――。\r\n\r\n温かくファンタジックなタッチで描かれる、\r\nユニークな人間たちの心の成長の物語。\r\n\r\n「1dayとなジャン漫画オーディション＠コミティア」大賞作家の\r\n連載デビュー作!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/05/azet_th-thumb-180xauto-328.png'),(87,'たとえばたして2でわって','http://www.tonarinoyj.jp/manga/tatoeba/','高校２年新学期、水戸部結子は変わろうとしていた。\r\n頼み事は断れない、周りに気を遣ってばかりの真面目キャラに嫌気が差し、\r\n友達に脱真面目キャラを宣言したはいいものの……。\r\n何故か真面目になりたい不良男子・御崎良太に目をつけられ、\r\n強引に協力させられることに!?\r\n\r\n「俺はお前のマネして、お前は俺のマネすりゃいいじゃん！」\r\nなりゆきで始まった男女２人のちぐはぐラブコメディ、ここに開幕!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/tatoeba_sum-thumb-180xauto-316.jpg'),(88,'甲乙少女','http://www.tonarinoyj.jp/manga/kootu/','甲斐あかり。乙部リカ。そこらへんにいる女子高生。\r\nでも２人の会話はどっかヘン!!\r\n\r\n的を射ているようで射ていない!?\r\nあるあるなようで全くナイ!?\r\n年頃女子のちぐはぐトークコメディ、いざ開幕!!\r\n\r\n「1dayとなジャン漫画オーディション＠コミティア」大賞作家の\r\n連載デビュー作!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/05/kootu_th-thumb-180xauto-330.png'),(89,'SHINKAI','http://www.tonarinoyj.jp/manga/shinkai6500/','深海――地球最後の領域といわれる未知の世界。\r\n日本が世界に誇る有人潜水調査船「しんかい6500」を繰って、\r\n真っ向からそこに挑む男たちがいる。\r\nJAMSTEC取材協力のもと実現した、深海フロンティアコミック！\r\n\r\n 史上初!?　マンガ×映像のコラボ機能実装!!\r\nマンガの右側にある「動画を再生する」ボタンを押すと、\r\nそのシーンに関連した“深海映像”を視聴できるぞ！\r\n※映像提供：JAMSTEC\r\n\r\n有人潜水調査船「しんかい6500」完成25周年記念特設サイトはこちら','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/05/shinkai6500_th-thumb-180xauto-332.jpg'),(90,'思春期サァカス','http://www.tonarinoyj.jp/manga/shishunki/','「f人魚」G3井田の最新作!!\r\nヤングジャンプ本誌で連載中の唯一の4コマ「思春期サァカス」、\r\n第1巻が3月19日（木）発売!!\r\n9話までを掲載中です!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/shisyunki-tn-thumb-180xauto-321.jpg'),(91,'となりの鬼子','http://www.tonarinoyj.jp/manga/oniko/','霊感体質の主人公のもとに、ある日、最強妖怪“鬼”が現れた…！死をも覚悟する主人公だが、よく見ると、その鬼は可愛い女の子!? しかも何故か人間に憧れている!!? 鬼の少女“鬼子”とのひとつ屋根の下のこわカワLOVE＆GAGストーリー!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/oniko-tn-thumb-180xauto-232.jpg'),(92,'二ツ星駆動力学研究所','http://www.tonarinoyj.jp/manga/tmfl/','かつて日本じゅうの少年たちが熱狂したカーホビー\"ミニ四駆\"!\r\n再燃するブームをきっかけに続々と復帰する元少年のオトナたちの中に漫画家・ハヤシケンタロウの姿があった。\r\n無理やり所属させられたミニ四駆チーム「二ツ星駆動力学研究所」の個性的なメンバーたちの無茶ぶりに翻弄されつつ、やがて「全力で遊ぶ」楽しさに覚醒してゆく…。','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/tmfl_yj_tn-thumb-180xauto-254.jpg'),(93,'アナーキー・イン・ザ・JK','http://www.tonarinoyj.jp/manga/anarchy/','アオハルオンラインから移籍して来た女子高生漫画。\r\n思春期の頃を思い出しても思いあたらない…。\r\n読むとちょっとだけ会話に参加したい。\r\n特異稀な女子高生たちの日常をつづった、愉快痛快オムニバスコメディ漫画！\r\nはっじまるよ～☆','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/anarchy-tn-thumb-180xauto-225.jpg'),(94,'週刊となりの高畠エナガ','http://www.tonarinoyj.jp/manga/w_enaga/','','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/enaga-tn-thumb-180xauto-305.jpg'),(95,'奥さま Guten Tag!','http://www.tonarinoyj.jp/manga/okusama/','ある日、ドイツ人の奥さまが出来たら…\r\nどうなる!? ユリアとタカシの結婚生活。\r\n気鋭のドイツ人女性漫画家デビュー作。\r\n漫画は国境を越えるのか！ 愛は国境を超えるのか!?\r\n日独異文化ＬＯＶＥコメディ♥','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/gutentag-thumbnail-thumb-180xauto-235.jpg'),(96,'All You Need Is Kill','http://www.tonarinoyj.jp/manga/all_you_need_is_kill/','出撃。戦死。出撃。戦死。\r\n死すら日常になる毎日。\r\n「ギタイ」と呼ばれる化物と人類の戦争を舞台に、初年兵キリヤ・ケイジの凄絶なる戦場の一日が始まる――。','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/allyou-tn-thumb-180xauto-242.jpg'),(97,'まいてはいけないローゼンメイデン','http://www.tonarinoyj.jp/manga/maitehaikenai/','「まきますか　まきませんか」\r\n本当にまきますか？　まいてもいいんですね？\r\n奇才・ちょぼらうにょぽみがフリーダムに描く\r\n「ローゼンメイデン」のスピンオフ！\r\n薔薇乙女たちの日常には危険がいっぱい!?','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/maitehaikenai-rozen_tn-thumb-180xauto-230.jpg'),(98,'はじマン　チャレンジ！はじめてのマンガ','http://www.tonarinoyj.jp/manga/hajiman/','「コマ割り」という最もマンガらしい部分に注目した、これまでにない\r\n「マンガＨＯＷ ＴＯマンガ」!\r\n読めばマンガが１００倍楽しくなる！描きたくなる！！\r\n投稿作品も大募集します！年齢・性別・職業関係なし！\r\n“マンガが好き”が唯一の条件！！\r\n\r\n個人情報の取り扱いについて','http://www.tonarinoyj.jp/manga/hajiman/images/thumb.png'),(99,'f人魚','http://www.tonarinoyj.jp/manga/funingyo/','地上には艶かしい“BL”の世界が広がる…\r\nなんて期待して海底からやってきた腐女子な人魚のメロと!!\r\n1組の“攻め”と“受け”が織り成す4コマGAG!!\r\n腐女子×BL×人魚＝f(腐)人魚!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/fningyo-tn-thumb-180xauto-237.jpg'),(100,'ねこぐるい 美奈子さん','http://www.tonarinoyj.jp/manga/nekogurui/','”猫は麻薬!?”ねこが可愛すぎて頭がやばい!!\r\nありそうで無かった圧倒的ねこ漫画!!\r\n全世界の猫好きさん達に共感の嵐のWEBコミック『ねこぐるい』が\r\nとなりのヤングジャンプへ移籍だ!!','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/nekogurui-tn-thumb-180xauto-233.jpg'),(101,'ひもうと！うまるちゃんS','http://www.tonarinoyj.jp/manga/umaruchans/','週刊ヤングジャンプで大人気連載中『干物妹！うまるちゃん』を、\r\n作者サンカクヘッドが勝手に（？）自分で（！？）スピンオフ（！！？）\r\n本編を読んでから読むと100倍楽しめる♪\r\n本編を読まなくても楽しめる♪\r\nパラレル世界の“うまるちゃんS”ここに見参ッ！！！！！','http://www.tonarinoyj.jp/manga/assets/assets_c/2015/04/umaruchans-tn-thumb-180xauto-222.jpg'),(102,'aaa','bbb','ccc',NULL);
